import React from 'react';
export default function Terms() {
  return <div className="max-w-2xl mx-auto py-20 text-center">
    <h1 className="text-3xl font-bold mb-4">Terms of Service</h1>
    <p className="text-gray-600 mb-4">By using JobNest, you agree to our terms:</p>
    <ul className="text-left mx-auto max-w-md text-gray-700 dark:text-gray-300">
      <li className="mb-2">• Use the platform respectfully</li>
      <li className="mb-2">• No spam or fraudulent activity</li>
      <li className="mb-2">• We reserve the right to suspend accounts for violations</li>
    </ul>
  </div>;
}
